import React from "react";
import "./Selector.css";

const Selector = (props) => {
    const {courses, selectedCourse, onSelectChange} = props;

    return (
        <div className="selector">
            <div>
                <p>Выберите курс</p>
            </div>
            <select value={selectedCourse} onChange={onSelectChange}>
                {
                    courses.map((course) => {
                        return (
                            <option key={course.course_number} value={course.course_number}>
                                {course.course_number}
                            </option>
                        )
                    })
                }
            </select>
        </div>
    );
}

export default Selector;
